import React from "react";
import Login from "../../components/Login/Login"; // Update the path based on your project structure
import "./LoginPage.css"; // Import any styles for your LoginPage component

const LoginPage = () => {
  return (
    <div className="login-page">
      <h1>Welcome to the Login Page</h1>
      <Login />
    </div>
  );
}

export default LoginPage;
